import "./App.css";
import Header from "./Header";
import Home from "./Home";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    // BEM convention name
    <Router>
      <div className="app">
        <Routes>
          <Route exact path="/" element={<><Home /><Header/></>}/>
          <Route path="/checkout" element={<Header />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
